import Login from './Login'
import Sheet from './Sheet';
import { useState } from 'react';

function App() {

  const [user, setUser] = useState([])


  return (
    <div>
      {
        user.length > 0 
        ? <Sheet></Sheet>
        : <Login></Login>
      }
    </div>
  );
}

export default App;
